import React from 'react'

const Search = () => {
  return (
    <>
      <input 
  style={{ color: 'blue', padding: '10px' , marginTop: '20px', borderRadius: ' 20px ' }} 
  type="text" 
  placeholder='Search anything' 
/>

    </>
  )
}

export default Search;
